import React from 'react';

function About() {
    return (
        <div>
            <h2>About Me</h2>
            <div className="about-content">
                <img src="https://avatars.githubusercontent.com/u/127463356" alt="A picture of me" />
                <p>Hi there! My name is Gage Cotton, and I'm a passionate junior web developer with a knack for creating engaging online experiences. With a strong foundation in computer troubleshooting and running SMB systems spanning five years, I bring a wealth of technical knowledge to my development journey.</p>
                <p>In the realm of web development, I've honed my skills in various technologies:</p>
                <ul>
                    <li>Node.js</li>
                    <li>MySQL and NoSQL databases</li>
                    <li>Express.js</li>
                    <li>HTML</li>
                    <li>JavaScript</li>
                    <li>CSS</li>
                </ul>
                <p>My goal is to craft clean, efficient, and visually appealing web solutions that leave a positive impact on users. Thank you for taking an interest in my journey as a developer!</p>
            </div>
        </div>
    );
}

export default About;
